import React from "react";
import { reduxForm, Field } from "redux-form";

const LoginForm = () => (
  <form>
    <div>
      <h1>Sign in / Login </h1>
    </div>
  </form>
);

LoginForm = reduxForm({
  form: "login"
})(LoginForm);

export default LoginForm;
